export default function Test() {
  return (
    <div style={{ border: "2px solid red" }}>
      <header style={{ justifyContent: "flex-end" }}>
        <Link className="navButton" to="/">
          <FaCross />
        </Link>
      </header>
      Dis is test yes
    </div>
  );
}
